  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0117012 contains raw underway
  meteorological, navigational, optical and physical data logged by the Scientific
  Computer System (SCS) aboard NOAA Ship Oscar Elton Sette in the North Pacific Ocean
  from 2013-09-11 to 2013-09-30. Office of Marine and Aviation Operations (OMAO) personnel
  aboard the ship submitted these data and associated metadata to NODC. In addition,
  NODC Accession 0117012 contains supplementary cruise-level metadata, which OMAO
  personnel logged in the Ship Daily Activity Log (SDAL). OMAO and NODC personnel
  developed the automated process to archive these data under the auspices of the
  NOAA Rolling Deck to Repository (NOAA R2R) program.\",\n\t\"license_title\": null,\n\t\"extras\":
